import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap'
import change_log from '../pages/change_log';
import '../App.css';

const Header = () => {
    return (
        <Navbar className="header_style" variant="dark" fixed="top" expand="md">
            <Navbar.Brand className="header_title">NUESS</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="me-auto">
                    <Nav.Link href="/">ホーム</Nav.Link>
                    <Nav.Link href="https://www.nara-edu.ac.jp/" target="_blank">奈良教育大学HP</Nav.Link>
                    <Nav.Link href="https://www.nara-edu.ac.jp/ADMIN/KYOUMU/syllabus/2022/KmkkbnIchiran_0_0.html" target="_blank">奈良教育大学時間割表</Nav.Link>
                    <LinkContainer to="/change_log">
                        <Nav.Link>更新情報</Nav.Link>
                    </LinkContainer>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
};

export default Header;
